insert  into `gear_product`(`id`,`module_id`,`cat_id`,`pro_id`,`pro_title`,`pro_full_desc`,`pro_price`,`no_of`,`pro_discount_price`,`pro_qty_stock`,`pro_image`,`pro_new`,`pro_create`,`pro_update`,`pro_flag`,`pro_display`,`sold_out`) values (1,1,1,'VBCG-001','Everlast Water Bottle','<ul>\r\n<li>Extra large wide-mouth top.</li>\r\n<li>Straw can be removed</li>\r\n<li>Extra heavy-weight for pro use.</li>\r\n<li>Easy dispersement from top.</li>\r\n</ul>\r\n',15,'',0,0,'gear-everlast-bottle.jpg','0','2009-10-28','2009-10-29 08:49:14','1','1','1'),(2,1,1,'VBCG-002','Everlast Mexican Style Handwraps','<ul>\r\n<li>Sturdy cotton/spandex blend.</li>\r\n<li>Thumb loop for easy wrapping with Hook and Loop closure.</li>\r\n<li>Size: 2\" x 180\"</li>\r\n</ul>\r\n',20,'',0,0,'gear-mexican-handwraps.jpg','0','2009-10-28','2009-10-29 09:12:11','1','1','1'),(3,1,1,'VBCG-003','Title Mexican Style Handwraps','<ul>\r\n<li>Super tough, great fit and protection.</li>\r\n<li>A full 180 inches in length.</li>\r\n<li>Hook-and-loop closure for self attachment.</li>\r\n</ul>\r\n',20,'',0,0,'gear-title-handwraps.jpg','0','2009-10-28','2009-10-29 09:12:46','1','1','1'),(4,1,1,'VBCG-004','Everlast Gel Glove Wraps','<ul>\r\n<li>Elastic Straps for wrist support.</li>\r\n<li>Neoprene with palm vent for comfort.</li>\r\n<li>Cushioning for knuckles.</li>\r\n<li>Sizes: S, M, L, XL, Youth</li>\r\n</ul>\r\n',45,'',0,0,'gear-evergel-wraps.jpg','0','2009-10-28','2009-10-29 09:13:15','1','1','1'),(5,1,1,'VBCG-005','Ever-guard Single Mouthguard','<ul>\r\n<li>Made of special biocompatable thermoplastic polymer.</li>\r\n<li>Anatomical shape guarantees excellent stability in the athlete\'s mouth while allowing for unobstructed breathing.</li>\r\n<li>Colors: Black, Clear</li>\r\n</ul>\r\n',35,'',0,0,'gear-everguard.jpg','0','2009-10-28','2009-10-29 09:01:26','1','1','1'),(6,1,1,'VBCG-006','Brain-pad Standard Mouthguard','<ul>\r\n<li>The Brain-Pad Mouthguard has revolutionized the industry.</li>\r\n<li>A tremendous mouthguard, offering unbelievable protection.</li>\r\n<li>Carrying case is included.</li>\r\n<li>Colors: Black/Grey, Clear, Grey/Yellow</li>\r\n</ul>\r\n',45,'',0,0,'gear-brainpad-mouthguard.jpg','0','2009-10-28','2009-10-29 09:02:45','1','1','1'),(7,1,1,'VBCG-007','Everlast Personal Timer','<ul>\r\n<li>Easy-to-use timer.</li>\r\n<li>Adjustable workout times.</li>\r\n<li>Built in vibration and ring gong.</li>\r\n<li>Built in alerts at the end of each round.</li>\r\n<li>Ideal for workouts, or other types of interval training.</li>\r\n</ul>\r\n',35,'',0,0,'gear-personal-timer.jpg','0','2009-10-28','2009-10-29 09:04:00','1','1','1'),(8,1,1,'VBCG-008','Everlast Full Coverage Headgear','<ul>\r\n<li>Water-resistant top grain leather.</li>\r\n<li>Closed cell foam technology.</li>\r\n<li>Narrow padding for maximum vision.</li>\r\n<li>Light foam for quicker head movement.</li>\r\n<li>New air release ear channels.</li>\r\n<li>Colors: Black, Red, Blue</li>\r\n</ul>\r\n',110,'',0,0,'gear-full-headgear.jpg','0','2009-10-28','2009-10-29 11:42:11','1','1','0'),(9,1,1,'VBCG-009','Everlast Protex 2 Gloves 16oz','<ul>\r\n<li>Superior wrist protection & comfort.</li>\r\n<li>Maximizes your grip punching power.</li>\r\n<li>Evercool strategic airflow.</li>\r\n<li>Hook & Loop for secure fit.</li>\r\n<li>Thumblok protects against injury.</li>\r\n<li>Color: Black</li>\r\n</ul>\r\n',80,'',0,0,'gear-protex-gloves.jpg','0','2009-10-28','2009-10-29 09:06:22','1','1','1'),(10,1,1,'VBCG-010','Everlast Training Gloves 14oz','<ul>\r\n<li>Pro style gloves for optimum training.</li>\r\n<li>Dense two-layer foam provides better shock absorbency.</li>\r\n<li>Full padding on the front, back and wrist to promote proper punching technique.</li>\r\n<li>ThumbLok feature for added safety.</li>\r\n</ul>\r\n',70,'',0,0,'gear-hook-gloves.jpg','0','2009-10-28','2009-10-29 09:07:46','1','1','1'),(11,1,1,'VBCG-011','Everlast Traditional Style Headgear','<ul>\r\n<li>Narrow front padding for maximum vision.</li>\r\n<li>Light-weight foam for quicker head movement.</li>\r\n<li>Air release ear channels.</li>\r\n<li>Colors: Black, Red, Blue</li>\r\n</ul>\r\n',99,'',0,0,'gear-trad-headgear.jpg','0','2009-10-28','2009-10-29 09:09:18','1','1','1'),(12,1,1,'VBCG-012','Hydrolast Lo Boxing Boot','<ul>\r\n<li>Michelin HydroLast compound outsole.</li>\r\n<li>Performance contoured midsole.</li>\r\n<li>Breathable mesh panels keep feet cool.</li>\r\n<li>Lightweight synthetic leather & mesh upper for support.</li>\r\n<li>Molded thermo plastic heel counter.</li>\r\n</ul>\r\n',189,'',0,0,'gear-hydrolast-boot.jpg','0','2009-10-28','2009-10-29 09:10:37','1','1','1'),(13,1,1,'VBCG-013','Pro plastic Speed Rope','<ul>\r\n<li>Super fast lightweight plastic.</li>\r\n<li>Sealed all bearing handles for speed and precision.</li>\r\n<li>Extra long and durable plastic rope.</li>\r\n<li>Sizes: 8\', 9\', 10\'</li>\r\n<li>Colors: Orange, Blue, Black</li>\r\n</ul>\r\n',25,'',0,0,'gear-prospeed-rope.jpg','0','2009-10-28','2009-10-29 11:41:39','1','1','0');

